25	13	18	Lead Site Reliability Engineer (.NET) - Platforms	Our ambitious team at Employment Hero is on a quest to transform employment, making it easier and more valuable for everyone. Our world-class software is the easiest way for small and medium-sized businesses to manage HR, payroll, employee engagement, and benefits. \n\nSince our inception in 2014, we've had enormous growth (100% YoY), now serving 300,000 businesses globally, with 2 million+ users on the platform, reaching unicorn status in 2022 - and we have no plans of slowing down. \n\nTheres never been a more exciting time to join one of the fastest-growing global unicorns, so lets see if we could be a match!\n\nIn your role, you'll be focused on\n\nWe're a team of global innovators, who cherish diverse perspectives that fuel our mission; to simplify the world of work for SMBs worldwide. \n\nAs a Senior/Lead Engineer in the .NET Platform team, you will be hands-on coding, and potentially leading a team of engineers across our Platform and Payroll areas, responsible for site reliability, infrastructure and DevOps. Youll help drive the journey we're on moving to a service-oriented architecture and a modernised technology stack, as well as improving the stability, security and performance of our Payroll system. You will help to ensure work is delivered successfully and to a high quality, and you will get the best out of your team.\n\nYou have experience leading or mentoring teams, as well as modernising and transforming systems to stabilise, improve performance, and adapt to rapid global growth. You have a flexible / growth mindset, with a strong desire to continuously learn.\n\nYou'll accelerate your career quickly, working with smart people across the APAC and UK regions, in a fully remote, flexible, and casual environment. We also encourage our teams to work smart, leveraging Github Copilot and other generative AI tech.\n\nAs a Lead Site Reliability Engineer (.NET), youll be:\n\nLead the design, implementation, and maintenance of highly available and scalable infrastructure and services.\nOptimise our usage of AWS Technologies to align with industry security best practices.\nDevelop and implement best practices for monitoring, alerting, and incident response to ensure system reliability and availability.\nAutomate deployment, configuration, and management processes to streamline operations and enhance efficiency.\nConduct performance analysis and capacity planning to proactively address scalability challenges and optimise resource utilisation.\nCollaborate with software engineering teams to ensure that applications are designed for reliability, scalability, and performance.\nDrive continuous improvement through the evaluation and adoption of new technologies, tools, and methodologies.\nDebugging and performing root cause analysis for application issues.\nProactively identifying application pain points and suggesting mitigation strategies.\nTaking initiative in improving the development process.\nYoure the hero were looking for if: \n\nExperience as a .NET Software Development Engineer, particularly for a cloud-based SaaS.\nExperience with C#, ASP.NET MVC, .NET Core, SQL Server.\nExperience with cloud computing platforms such as AWS, and enforcing secure cloud infrastructure.\nExperience in developing software, using microservices or SOA architecture for deployment on public clouds, preferably AWS.\nGood understanding of database concepts and experience working with relational databases such as MS SQL.\nStrong knowledge of Elastic Beanstalk\nStrong knowledge of containerization and orchestration technologies such as Docker and Kubernetes (EKS).\nExperience using Agile methodologies and working with Product teams\nQuality coding practices, including test-driven development, unit testing and secure coding awareness.\nYou are passionate about learning and sharing your knowledge, and not afraid to challenge your peers, but also welcome being challenged.\nEnglish language abilities, both written and verbal - youll be leading people across the world.\nThe EH Way\nThe EH Way is how we describe our culture at Employment Hero and how we all operate. It is our DNA. You can read all about it on our careers page:  \n\nIn short, youll love working with us if:\n\nRevolutionising employment gets your heart racing.\nYou thrive on the flexibility (and responsibility) of a remote-first business.\nOur values align, and shape how you show up every day.\nYou love the dynamic pace of a startup, are driven by innovation, and enjoy working with other smart people.\nPlus, youll get to enjoy a number of great perks, including: \n\nA generous budget for your home office.\nCutting-edge tools and technology.\nReward and recognition programs - because great work should be recognised and rewarded.\nCashback offers and discounts on popular brands through our Swag app.\nEmployee Share Option Program: be an owner of Employment Hero.\nAnnual Global Gathering - so far weve been to Thailand, Vietnam and are excited to meet in Bali in September 2024.	DevOps	normal	Government	160000 - 180000	Annual	Remote	4	Mid-Senior Level	{"AWS,",AWS.,SQL,ASP.NET,Kubernetes,AWS,Docker,SQL.}	Sydney	NSW	Australia	2024-07-23	https://apply.workable.com/employment-hero/j/B592724A3A/	{"Australian Citizen","Australian Permanent Resident"}	2024-06-23 01:52:00.710218	2024-06-23 01:52:00.710218	'000':67 '100':62 '2':71 '2014':56 '2022':81 '2024':770 '300':66 'abil':591 'acceler':280 'across':171,288,600 'adapt':260 'address':391 'adopt':421 'afraid':579 'agil':547 'ai':316 'alert':361 'align':348,666 'also':303,585 'ambiti':8 'analysi':385,433 'annual':751 'apac':290 'app':740 'applic':406,435,439 'architectur':198,504 'area':176 'asp.net':477 'autom':371 'avail':335,370 'aw':345,490,511 'awar':567 'bali':767 'base':472 'beanstalk':531 'benefit':51 'best':236,352,357 'brand':736 'budget':707 'busi':43,68,663 'c':476 'capac':387 'career':282,635 'cashback':730 'casual':300 'caus':432 'challe